package com.example.foodapp.repository;

import android.app.Application;

import com.example.foodapp.repository.model.Recipe;
import com.example.foodapp.repository.model.RecipeResponse;

import java.util.ArrayList;
import java.util.List;

import io.reactivex.rxjava3.core.Single;

public class RecipeRepository {

    public RecipeRepository(Application application) {
    }

    public Single<RecipeResponse> searchRecipe(String query, Integer nextPageNumber) {
        List<Recipe> list = new ArrayList<>();
        list.add(
                new Recipe(nextPageNumber,
                        nextPageNumber + " intro",
                        nextPageNumber + " description",
//                        "data:image/jpeg;base64,"
                ""
                )
        );
        return Single.just(
                new RecipeResponse(list, nextPageNumber)
        );
    }
}
